import React from 'react';

const EmployeeItem = ({ employee }) => {
  return (
    <div>
      <img src={employee.picture.thumbnail} alt={`${employee.name.first} ${employee.name.last}`} />
      <p>{`${employee.name.first} ${employee.name.last}`}</p>
      <p>{employee.email}</p>
    </div>
  );
};

export default EmployeeItem;
